fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nodular_episcleritis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :photophobia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cornea_symptom ],
        :scleral_disease ;
    :has_definition "A scleral disease that is characterized by painful inflammation with surface nodule formation of the episcleral tissues that, importantly, spares the sclera itself and has_symptom pain, red eyes, photophobia, tearing, blurry vision, and appearance of eye surface irregularity. Nodular episcleritis is typically self-limited and may be caused by vascular congestion within the superficial episcleral plexus." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_epulis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :epulis,
        :physical_disorder ;
    :has_exact_synonym "Congenital Epulides"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:uterine_corpus_adenocarcinofibroma rdfs:subClassOf :uterine_body_mixed_cancer ;
    :has_definition "A uterine body mixed cancer that derives_from epithelial cells which originate in glandular tissue and connective tissue." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skene_gland_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :paraurethral_gland ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :carcinoma,
        :paraurethral_gland_cancer ;
    :has_exact_synonym "carcinoma of the paraurethral gland"@en,
        "paraurethral gland carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometrial_endometrioid_adenocarcinoma_secretory_variant rdfs:subClassOf :endometrial_adenocarcinoma ;
    :has_definition "An endometrial adenocarcinoma that is characterized by the presence of confluent, cribriform or villoglandular voluminous glands with glycogen, subnuclear vacuoles (resembles day 17 - 22 endometrium), plus late secretory pattern in uninvolved endometrium." ;
    :has_exact_synonym "secretory uterine corpus endometrioid adenocarcinoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucin_rich_endometrial_endometrioid_adenocarcinoma rdfs:subClassOf :endometrial_adenocarcinoma ;
    :has_definition "An endometrial adenocarcinoma that is characterized by the presence of abundant mucin." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_extraosseous_osteosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :extraosseous_osteosarcoma ;
    :has_definition "An extraosseous osteosarcoma that arises from the soft tissue and occurs during childhood." ;
    :has_exact_synonym "Childhood Extraskeletal Osteosarcoma",
        "pediatric extraskeletal Osteosarcoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urethral_benign_neoplasm rdfs:subClassOf :urethral_disease,
        :urinary_system_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :urethra ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "neoplasm of urethra"@en,
        "neoplasm. urethra"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astroblastoma rdfs:subClassOf :malignant_astrocytoma ;
    :has_definition "A malignant astrocytoma that is characterized by tumor cells with characteristics suggestive of an astrocytic origin (positive for GFAP), arranged perivascularly." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urinary_system_benign_neoplasm rdfs:subClassOf :organ_system_benign_neoplasm,
        :urinary_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :renal_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system benign neoplasm that is located_in the kidneys, ureteres, bladder or urethra." ;
    :has_exact_synonym "neoplasm of urinary system"@en,
        "tumor of the urinary system"@en,
        "tumor of urinary tract"@en,
        "urinary tract neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:jewett_marshall_bladder_cancer rdfs:subClassOf :bladder_carcinoma ;
    :has_exact_synonym "stage IVB urinary bladder carcinoma"@en ;
    :has_related_synonym "Jewett-Marshall stage D1 bladder cancer"@en,
        "Jewett-Marshall stage D2 bladder cancer"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urethral_disease rdfs:subClassOf :urinary_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :urethra ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A urinary system disease that is located_in the urethra." ;
    :has_exact_synonym "urethra disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_serous_cystadenofibroma rdfs:subClassOf :ovarian_serous_adenofibroma ;
    :has_definition "An ovarian serous adenofibroma that is characterized by the presence of cysts or cystic spaces." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pseudosarcomatous_fibromatosis rdfs:subClassOf :fasciitis ;
    :has_exact_synonym "Fasciitis - nodular"@en,
        "Pseudosarcomatous Fasciitis"@en,
        "nodular fasciitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iris_spindle_cell_melanoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :melanocyte ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :iris ],
        :malignant_iris_melanoma,
        :melanoma ;
    :has_definition "A malignant melanoma of iris and spindle cell intraocular melanoma that is located_in the iris." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophageal_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chest_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphagia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :esophagus ],
        :esophageal_disease,
        :gastrointestinal_tuberculosis ;
    :has_definition "A gastrointestinal tuberculosis that involves formation of tuberculous ulcers located_in esophagus. The infection has_symptom dysphagia, has_symptom cough, has_symptom chest pain, has_symptom fever and has_symptom weight loss." ;
    :has_exact_synonym "tuberculosis of esophagus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nephrogenic_adenoma_of_urinary_bladder rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :urinary_bladder ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :epithelial_cell ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_origin ;
                                    owl:someValuesFrom :gland ] ;
                            rdf:rest :nil ] ] ],
        :adenoma,
        :bladder_benign_neoplasm ;
    :has_exact_synonym "Nephrogenic adenoma of the urinary bladder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nephrogenic_adenoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :epithelial_cell ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_origin ;
                                    owl:someValuesFrom :gland ] ;
                            rdf:rest :nil ] ] ],
        :adenoma,
        :kidney_benign_neoplasm .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urethra_cancer rdfs:subClassOf :urethral_disease,
        :urinary_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :urethra ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An urinary tract cancer that derives_from the tissues of the urethra." ;
    :has_exact_synonym "malignant tumour of urethra"@en,
        "malignant urethral neoplasm"@en,
        "urethral Ca"@en ;
    :has_related_synonym "cancer of urethra"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_ovarian_dysgerminoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_ovarian_germ_cell_tumor ;
    :has_definition "A childhood ovarian germ cell tumor that derives_from cells that give rise to egg cells." ;
    :has_exact_synonym "pediatric ovarian dysgerminoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_stromal_hyperthecosis rdfs:subClassOf :ovarian_disease ;
    :has_definition "An ovarian disease that is characterized by the presence of nests of luteinized theca cells scattered throughout the ovary, which results in severe hyperandrogenism and insulin resistance. Clinical symptoms involve slowly progressive acne, hirsutism, virilization." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rectum_sarcomatoid_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :rectum ],
        :rectum_cancer ;
    :has_exact_synonym "sarcomatoid carcinoma of rectum"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_keratinizing_squamous_cell_carcinoma rdfs:subClassOf :vulva_squamous_cell_carcinoma ;
    :has_definition "A vulva squamous cell carcinoma that is characterized by keratin pearls, abundant keratohyaline granules or dense cytoplasmic keratinization." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kimura_disease rdfs:subClassOf :skin_disease ;
    :has_exact_synonym "Kimura's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:superficial_urinary_bladder_cancer rdfs:subClassOf :bladder_carcinoma ;
    :has_definition "A carcinoma of bladder that originates in the epithelial cells (the internal lining) of the bladder wall and is limited to this area." ;
    :has_exact_synonym "Superficial urinary bladder carcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adrenal_medulla_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :adrenal_medulla ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :adrenal_medulla_cancer,
        :carcinoma ;
    :has_definition "An adrenal medulla cancer that has_material_basis_in abnormally proliferating cells derives_from epithelial cells." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:squamous_cell_papilloma_of_skin rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :mucosa ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        :skin_papilloma ;
    :has_exact_synonym "Parakeratotic skin papilloma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_vein_leiomyosarcoma rdfs:subClassOf :leiomyosarcoma,
        :vascular_cancer,
        :vein_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :leiomyosarcoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :pulmonary_vein ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A leiomyosarcoma that is located_in the pulmonary vein." ;
    :has_exact_synonym "leiomyosarcoma of the pulmonary Vein"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_artery_leiomyosarcoma rdfs:subClassOf :artery_disease,
        :leiomyosarcoma,
        :vascular_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :leiomyosarcoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :pulmonary_artery ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A leiomyosarcoma that is located_in the pulmonary artery." ;
    :has_exact_synonym "leiomyosarcoma of the pulmonary artery"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:superior_vena_cava_leiomyosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :anterior_vena_cava ],
        :leiomyosarcoma,
        :vascular_cancer,
        :vein_disease ;
    :has_definition "A leiomyosarcoma that is located_in the superior vena cava." ;
    :has_exact_synonym "leiomyosarcoma of the Superior Vena Cava"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_primitive_neuroectodermal_tumor rdfs:subClassOf :cerebrum_cancer ;
    :has_exact_synonym "PNET of Cerebrum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hematopoietic_system_disease rdfs:subClassOf :disease_of_anatomical_entity ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :hematopoietic_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease of anatomical entity that has_material_basis_in hematopoietic cells." ;
    :has_exact_synonym "Blood disease"@en,
        "Blood dyscrasia"@en,
        "DISEASE OF THE BLOOD AND BLOOD-FORMING ORGANS"@en,
        "Hematological disease"@en,
        "blood disorder"@en,
        "disease of haematopoietic system"@en,
        "disease of hematopoietic system"@en,
        "haematopoietic system disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nijmegen_breakage_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by chromosomal instability, microcephaly, growth retardation, immunodeficiency, cellular hypersensitivity to X-rays, and predisposition to cancer that has_material_basis_in homozygous or compound heterozygous mutation in NBN on chromosome 8q21.3." ;
    :has_exact_synonym "Berlin breakage syndrome"@en,
        "Microcephaly, normal intelligence and immunodeficiency"@en,
        "NBS"@en,
        "Seemanova syndrome II"@en,
        "Seemanova syndrome type 2"@en,
        "ataxia-telangiectasia variant"@en,
        "immunodeficiency-microcephaly-chromosomal instability syndrome"@en,
        "microcephaly-immunodeficiency-lymphoreticuloma syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_keratoacanthoma rdfs:subClassOf :vulva_squamous_cell_carcinoma ;
    :has_definition "A vulva squamous cell carcinoma that is rapidly growing, self-limited, and characterized by the presence of a central crater that contains squamous cells. The proliferating squamous cells infiltrate the dermis below and produce keratin masses that are pushed towards the surface of the tumor. It is considered a variant of well-differentiated squamous cell carcinoma with distinct clinical behavior." ;
    :has_exact_synonym "vulvar keratoacanthoma-like carcinoma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_non_keratinizing_squamous_cell_carcinoma rdfs:subClassOf :vulva_squamous_cell_carcinoma ;
    :has_definition "A vulva squamous cell carcinoma that is composed of polygonal squamous cells growing in sheets or nests that may have intercellular bridges, but keratin pearls are not present." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_endometrioid_cystadenofibroma rdfs:subClassOf :ovarian_endometrioid_adenofibroma ;
    :has_definition "An ovarian endometrioid adenofibroma that is characterized by the presence of cysts and/ or cystic spaces." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cutaneous_anthrax rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        :anthrax_disease,
        :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :anthrax_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :zone_of_skin ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An anthrax disease that results_in infection located_in skin, has_material_basis_in Bacillus anthracis, which is transmitted_by contact with infected animals or animal products. The infection has_symptom skin lesion that eventually forms an ulcer with a black center." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anthrax_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bacillus_anthracis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_ulcer ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hematochezia ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :airborne_transmission ;
                                    rdf:rest [ rdf:first :vehicle_borne_ingestion_transmission ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rectorrhagia ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in infection located_in skin, located_in lung lymph nodes or located_in gastrointestinal tract, has_material_basis_in Bacillus anthracis, transmitted_by contact with infected animals or animal products, transmitted_by airborne spores or transmitted_by ingestion of undercooked meat from infected animals and has_symptom skin ulcer, has_symptom nausea, has_symptom poor appetite, has_symptom bloody diarrhea, has_symptom fever or has_symptom shortness of breath." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_brain_germinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :brain_germinoma ;
    :has_definition "A brain germinoma that is characterized by tumor of the germ cell in childhood that has_material_basis_in abnormally proliferating cells derives_from germ cells, located_in pineal area and located_in suprasellar area." ;
    :has_exact_synonym "germinoma of the pediatric brain"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dermatographia rdfs:subClassOf :physical_urticaria ;
    :has_definition "A physical urticaria induced by stroking of the skin." ;
    :has_exact_synonym "dermatographic urticaria"@en,
        "dermographism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_germ_cell_brain_tumor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
