@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endocervical_type_cervical_adenomyoma rdfs:subClassOf :cervical_adenomyoma ;
    :has_definition "A cervical adenomyoma that is located_in the endocervix and is characterized by a well circumscribed neoplasm composed of irregularly shaped, benign endocervical-type glands, admixed with myomatous smooth muscle." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometrial_type_cervical_adenomyoma rdfs:subClassOf :cervical_adenomyoma ;
    :has_definition "A cervical adenomyoma that is characterized by glands and cysts lined by a single layer of endocervical-type mucinous epithelium admixed with smooth muscle." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cervical_atypical_polypoid_adenomyoma rdfs:subClassOf :cervical_adenomyoma ;
    :has_definition "A cervical adenomyoma that is tumor of endometrium, lower uterine segment and endocervix and is characterized by atypical complex glands with squamous metaplasia mixed with myofibromatous stroma." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fallopian_tube_gestational_choriocarcinoma rdfs:subClassOf :fallopian_tube_carcinoma,
        :gestational_choriocarcinoma ;
    :has_definition "A gestational choriocarcinoma that is located_in the fallopian tube." ;
    :has_exact_synonym "Gestational Choriocarcinoma of the fallopian tube"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gestational_uterine_corpus_choriocarcinoma rdfs:subClassOf :gestational_choriocarcinoma,
        :uterine_corpus_choriocarcinoma ;
    :has_definition "A gestational choriocarcinoma that is located_in the uterine corpus." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
