            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :connective_tissue_disease ;
    :has_definition "A connective tissue disease characterized by inflammation located_in the mediastinum, which extends from the diaphragm to the thoracic inlet and between the pleural cavities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myotonic_cataract rdfs:subClassOf :cataract ;
    :has_definition "A cataract that is characterized by multicolored, iridescent opacification of the lens of the eye, and associated with myotonic dystrophy." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myocarditis rdfs:subClassOf :extrinsic_cardiomyopathy ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_symptom ;
                                                    owl:someValuesFrom :inflammation ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :disease_has_location ;
                                                            owl:someValuesFrom :myocardium ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An extrinsic cardiomyopathy that is characterized as an inflammation of the heart muscle." ;
    :has_exact_match "MESH:D009205" ;
    :has_exact_synonym "Myocardial inflammation"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tertiary_syphilis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        :syphilis ;
    :has_definition "A syphilis that is characterized as the third stage of syphilis that develops after the disappearance of the secondary symptoms and is marked by ulcers and gummas under the skin and commonly by involvement of the skeletal, cardiovascular, and nervous systems." ;
    :has_exact_synonym "late syphilis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

