            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung_hilus ],
        :lung_carcinoma,
        :lung_hilum_cancer .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lung_superior_sulcus_carcinoma rdfs:subClassOf :pancoast_tumor ;
    :has_exact_synonym "Superior Sulcus carcinoma of the lung"@en ;
    :has_related_synonym "superior sulcus carcinoma of lung"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fallopian_tube_cystadenofibroma rdfs:subClassOf :fallopian_tube_adenofibroma ;
    :has_definition "A fallopian tube adenofibroma that is characterized by the presence of cysts and/or cystic spaces." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parapharyngeal_meningioma rdfs:subClassOf :meningioma ;
    :has_exact_synonym "Primary Parapharyngeal Meningioma" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:upper_clivus_meningioma rdfs:subClassOf :clivus_meningioma ;
    :has_exact_synonym "meningioma of the Upper Clivus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_breast_papilloma rdfs:subClassOf :breast_duct_papilloma ;
    :has_definition "A breast duct papilloma that is located_in a major duct." ;
    :has_exact_synonym "large duct breast papilloma"@en,
        "solitary intraductal breast papilloma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atypical_breast_papilloma rdfs:subClassOf :breast_duct_papilloma ;
    :has_definition "A breast duct papilloma that is characterized by the presence of cells that are abnormal but are not yet malignant." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:periapical_periodontitis rdfs:subClassOf :periodontitis ;
    :has_exact_synonym "Apical periodontitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intrahepatic_biliary_papillomatosis rdfs:subClassOf :biliary_papillomatosis ;
    :has_definition "A biliary papillomatosis located_in an intrahepatic bile duct." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lower_clivus_meningioma rdfs:subClassOf :clivus_meningioma ;
    :has_exact_synonym "meningioma of the lower Clivus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:periodontitis rdfs:subClassOf :periodontal_disease ;
    :has_exact_synonym "chronic pericementitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meningeal_melanomatosis rdfs:subClassOf :central_nervous_system_melanocytic_neoplasm ;
    :has_definition "A central nervous system melanocytic neoplasm that is characterized as an extra-axial well-encapsulated malignant tumour with diffuse meningeal growth and dark coloration (due to high melanin contents)." ;
    :has_exact_synonym "Leptomeningeal melanomatosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

