            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :pleomorphic_rhabdomyosarcoma .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_rhinitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        :rhinitis ;
    :has_definition "A rhinitis which is persistent and long-lasting. It may occur with diseases such as syphilis, tuberculosis, rhinoscleroma, rhinosporidiosis, leishmaniasis, blastomycosis, histoplasmosis, and leprosy, all of which are characterized by the formation of inflamed lesions (granulomas) and the destruction of soft tissue, cartilage, and bone. Chronic rhinitis causes nasal obstruction, pus-filled discharge from the nose, and frequent bleeding." ;
    :has_exact_synonym "Rhinitis - chronic"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

