            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :mammalian_vulva ],
        :skin_tag,
        :vulvar_disease ;
    :has_exact_synonym "Vulval Fibroepithelial polyp"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ureter_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ureter ],
        :ureteral_disease,
        :urogenital_tuberculosis ;
    :has_definition "An urogenital tuberculosis that is located_in ureter resulting in ureteral strictures." ;
    :has_exact_synonym "tuberculosis of ureter"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

