    :has_definition "A female urethral cancer located_in the anterior urethra." ;
    :has_exact_synonym "Anterior urethral malignant tumor"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

