@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peritonitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_tenderness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :oliguria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :gastrointestinal_system_disease ;
    :has_definition "A gastrointestinal system disease that involves inflammation of the peritoneum resulting from perforation of the gastrointestinal tract, which produces immediate chemical inflammation followed shortly by infection from intestinal organisms. Peritonitis can also result from appendicitis, diverticulitis, strangulating intestinal obstruction, pancreatitis, pelvic inflammatory disease, mesenteric ischemia, intraperitoneal blood, barium, or peritoneo-systemic shunts, drains, and dialysis catheters in the peritoneal cavity. The symptoms include abdominal pain and tenderness, fever, fluid in the abdomen, nausea, vomiting and low urine output." ;
    :has_exact_synonym "Retractile mesenteritis"@en,
        "acute generalized peritonitis"@en,
        "primary bacterial peritonitis"@en,
        "sclerosing mesenteritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clear_cell_squamous_cell_skin_carcinoma rdfs:subClassOf :skin_squamous_cell_carcinoma ;
    :has_exact_synonym "Clear cell squamous cell carcinoma of skin"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scabies rdfs:subClassOf :mite_infestation ;
    :has_definition "A mite infestation that is a contagious ectoparasite skin infection caused by human itch mite Sarcoptes scabiei type hominis, which burrows into the upper layer of the skin but never below the stratum corneum causing severe itching and a rash found on the hands, folds of the wrist, elbow or knee, penis, breast, and shoulder blades." ;
    :has_exact_match "MESH:D012532" ;
    :has_exact_synonym "Infestation by Sarcoptes scabiei"@en,
        "Infestation by Sarcoptes scabiei var hominis"@en,
        "Sarcoptic itch"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cataract rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :lens_disease,
        :monogenic_disease ;
    :has_definition "A lens disease characterized by clouding of the lens inside the eye which leads to a decrease in vision." ;
    :has_exact_match "MESH:D002386" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_endometrial_stromal_and_smooth_muscle_tumor rdfs:subClassOf :uterine_corpus_cancer ;
    :has_definition "A uterine corpus cancer that has_material_basis_in endometrial stroma and smooth muscle cells." ;
    :has_exact_synonym "Stromomyoma"@en .

