    :has_definition "A cervical adenocarcinoma that is characterized by tumor cells that are identical to those in adenocarcinoma in situ (ACIS) and mcroscopic findings that suggest invasion." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

