    :has_definition "A proliferative type fibrocystic change of breast that is characterized by enlarged lobules that are distorted by scar-like tissue and excess glandular tissue." ;
    :has_exact_synonym "Sclerosing breast Adenosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:auditory_system_cancer rdfs:subClassOf :auditory_system_disease,
        :sensory_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :auditory_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system cancer located_in the ear and characterized by uncontrolled cellular proliferation of the auditory organs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:perineural_angioma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :perineural_vascular_plexus ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :endothelial_cell ],
        :central_nervous_system_benign_neoplasm,
        :hemangioma .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_choriocarcinoma_of_the_ovary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :choriocarcinoma_of_ovary ;
    :has_definition "A choriocarcinoma of the ovary that is present during childhood." ;
    :has_exact_synonym "childhood ovarian choriocarcinoma"@en,
        "pediatric Choriocarcinoma of Ovary"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:appendicitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        :cecal_disease ;
    :has_definition "A gastrointestinal system infectious disease that involves inflammation and infection of the appendix caused by the blockage of the lumen with a small, hard piece of stool, a foreign body or worms. Mucus backs up in the appendiceal lumen, causing bacteria that live inside the appendix to multiply. The infection has_symptom pain, in the upper abdomen initially and later in the lower abdomen, has_symptom nausea, has_symptom vomiting and has_symptom fever." ;
    :has_exact_synonym "acute appendicitis"@en,
        "acute appendicitis with generalized peritonitis"@en,
        "acute appendicitis with peritoneal abscess"@en .

