        :aortic_disease,
        :vascular_cancer ;
    :has_definition "A vascular cancer that is located_in the aorta." ;
    :has_exact_synonym "aortic malignant neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epithelioid_malignant_peripheral_nerve_sheath_tumor rdfs:subClassOf :malignant_peripheral_nerve_sheath_tumor ;
    :has_exact_synonym "epithelioid MPNST"@en,
        "malignant epithelioid neoplasm of the peripheral nerve Sheath"@en .

