            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :testicular_granulosa_cell_tumor .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteoarthritis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :arthritis ],
        :arthritis ;
    :has_definition "An arthritis that has_material_basis_in worn out cartilage located_in joint." ;
    :has_exact_match "MESH:D010003" ;
    :has_exact_synonym "Osteoarthrosis and allied disorder"@en,
        "degenerative arthritis"@en,
        "degenerative joint disease"@en,
        "hypertrophic arthritis"@en,
        "osteoarthrosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trombiculiasis rdfs:subClassOf :mite_infestation ;
    :has_definition "A mite infestation that involves rash caused by Leptotrombidium deliense." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteochondritis_dissecans rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :epiphysis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        :ischemic_bone_disease ;
    :has_definition "An ischemic bone disease that results_in necrosis located_in epiphysis." ;
    :has_exact_synonym "OCD"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cork_handlers_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :wheezing ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :asthenia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        :extrinsic_allergic_alveolitis ;
    :has_definition "An extrinsic allergic alveolitis caused by inhalation of cork dust containing the antigens produced by the fungus Penicillium glabrum. The symptoms include dyspnea, wheezing cough, fever and asthenia." ;
    :has_exact_synonym "Suberosis"@en,
        "cork-handlers' disease or lung"@en,
        "cork-handlers' lung"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_cornea_melanoma rdfs:subClassOf :cornea_cancer ;
    :has_exact_synonym "malignant Corneal melanoma"@en,
        "malignant melanoma of cornea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meckel_s_diverticulitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :diverticulitis ;
    :has_definition "A diverticulits characterized by the inflammation of a congenital diverticulum, which is a slight bulge of the small intestine present at birth." ;
    :has_exact_synonym "Meckel diverticulitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microinvasive_cervical_squamous_cell_carcinoma rdfs:subClassOf :cervical_squamous_cell_carcinoma ;
    :has_definition "A cervical squamous cell carcinoma that is characterized by invasion which diagnosed by microscopy only. Invasion is limited to measured stromal invasion with a maximum depth of 5_mm and no wider than 7_mm diameter." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extrinsic_allergic_alveolitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_appetite ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :allergic_disease,
        :interstitial_lung_disease ;
    :has_definition "An interstitial lung disease involving inflammation of alveoli and smallest airways (bronchioles) of the lung caused by an allergic reaction to inhaled organic dusts containing microorganisms or proteins, and chemicals. Symptoms include chills, cough, fever, malaise, shortness of breath, loss of appetite and weight loss." ;
    :has_exact_synonym "alveolitis"@en,
        "hypersensitivity pneumonitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_kidney_angiomyolipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :kidney_angiomyolipoma ;
    :has_exact_synonym "pediatric renal Angiomyolipoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kidney_angiomyolipoma rdfs:subClassOf :kidney_benign_neoplasm ;
    :has_exact_synonym "Angiomyolipoma of kidney"@en,
        "renal Angiomyolipoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_fibrosarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_fibrosarcoma,
        :physical_disorder ;
    :has_exact_synonym "Infantile fibrosarcoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colloid_adenoma rdfs:subClassOf :follicular_adenoma ;
    :has_exact_synonym "Macrofollicular adenoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_glandular_tumor_of_peripheral_nerve_sheath rdfs:subClassOf :malignant_peripheral_nerve_sheath_tumor ;
    :has_exact_synonym "glandular MPNST"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:follicular_infundibulum_tumor rdfs:subClassOf :hair_follicle_neoplasm ;
    :has_exact_synonym "follicular infundibulum tumour"@en,
        "neoplasm of the Follicular Infundibulum"@en,
        "tumor of follicular infundibulum"@en,
        "tumour of follicular infundibulum"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_melanoma rdfs:subClassOf :retinal_cancer ;
    :has_exact_synonym "malignant Retinal melanoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_apocrine_carcinoma_in_situ rdfs:subClassOf :breast_carcinoma_in_situ ;
    :has_definition "A breast carcinoma in situ that is characterized by abundant eosinophilic apocrine cytoplasm and large nuclei. It is a variant of ductal carcinoma in situ of the breast." ;
    :has_exact_synonym "Apocrine carcinoma in situ of the breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polycythemia rdfs:subClassOf :bone_marrow_disease ;
    :has_definition "A bone marrow disease characterized by an increased number of red blood cells in the bloodstream resulting in thicker blood and reduced blood flow." ;
    :has_exact_synonym "Erythrocythemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:afferent_loop_syndrome rdfs:subClassOf :postgastrectomy_syndrome ;
    :has_definition "A postgastrectomy syndrome that is characterized by obstruction of the afferent loop that arises after gastric surgery with gastrojejunostomy reconstruction." ;
    :has_exact_match "MESH:D000343" ;
    :has_exact_synonym "Afferent limb syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:postgastrectomy_syndrome rdfs:subClassOf :functional_gastric_disease,
        :intestinal_disease ;
    :has_exact_synonym "Postgastric surgery syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ileus rdfs:subClassOf :intestinal_obstruction ;
    :has_exact_synonym "Ileus of intestine"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachial_plexus_lesion rdfs:subClassOf :brachial_plexus_neuropathy ;
    :has_definition "A brachial plexus neuropathy characterized by an abnormality, usually caused by disease or trauma, located in the brachial plexus." ;
    :has_exact_synonym "Brachial plexus lesions"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intestinal_volvulus rdfs:subClassOf :intestinal_obstruction ;
    :has_definition "An intestinal obstruction characterized by abnormal rotation of the intestines." ;
    :has_exact_synonym "Twist of intestine, bowel, or colon"@en,
        "Volvulus"@en,
        "familial intestinal malrotation"@en,
        "volvulus of midgut"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intussusception rdfs:subClassOf :intestinal_obstruction ;
    :has_exact_synonym "Intussusception of intestine"@en,
        "Invagination of intestine or colon"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cyclothymic_disorder rdfs:subClassOf :bipolar_disorder ;
    :has_definition "A bipolar disorder that involves recurrent hypomanic and dysthymic episodes, but no full manic episodes or full major depressive episodes." ;
    :has_exact_synonym "Affective personality disorder"@en,
        "Cycloid personality"@en,
        "Cyclothymia"@en,
        "Cyclothymic personality"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:riboflavin_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :cheilitis ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :stomatitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :conjunctivitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :glossitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anemia ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :angular_cheilitis ],
        :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease that is characterized by stomatitis, cheilosis, glossitis, conjunctivitis, and anemia, develops_from vitamin B2 (riboflavin) deficiency, has_symptom red chapped lips, painful swollen tongue, sore throat, blurred vision, and fatigue, and has_material_basis_in inadequate intake, endocrine disorder, liver disorder, alcoholism, and dialysis." ;
    :has_exact_synonym "ariboflavinosis",
        "vitamin B2 deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyridoxine_deficiency_anemia rdfs:subClassOf :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease that is characterized by normocytic anemia associated with deficiency of pyridoxine (vitamin B6), and has_material_basis_in decreased intake, malabsorption, increased clearance or breakdown, and certain medications (eg isoniazid)." ;
    :has_exact_synonym "vitamin B6 deficiency syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:choline_deficiency_disease rdfs:subClassOf :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease that is characterized by deficiency of choline, which has been associated with development of fatty liver, and possibly has_material_basis_in inadequate intake and exacerbated by a genetic predisposition." ;
    :has_exact_synonym "choline deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pellagra rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hallucination ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :dementia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :depression ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anorexia ],
        :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease that is characterized by deficiency of niacin (vitamin B3), has_symptom gastrointestinal disturbance, anorexia, diarrhea, dementia, hallucinations, depression, psychosis, and/or non-specific skin changes, and has_material_basis_in deficiency of niacin, often from inadequate diet, malabsorption, or medication side effects." ;
    :has_exact_synonym "Niacin deficiency"@en,
        "Niacin-tryptophan deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aicardi_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :chorioretinal_lacunae ],
        :syndrome ;
    :has_definition "A syndrome that is characterized by absence or underdeveloped tissue connecting the left and right halves of the brain, infantile spasms and chorioretinal lacunae, which are defects in the light-sensitive tissue at the back of the eye." ;
    :has_exact_match "MESH:D058540" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_degeneration rdfs:subClassOf :eye_degenerative_disease,
        :retinal_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :eye_degenerative_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :retina ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A retinal disease that is characterized by deterioration of the retina caused by the progressive and eventual death of the cells of the retina." ;
    :has_exact_synonym "degeneration of retina"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:influenza rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :droplet_spread_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :severe_headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rhinorrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weakness ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :respiratory_system ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :alphainfluenzavirus ;
                            rdf:rest [ rdf:first :betainfluenzavirus ;
                                    rdf:rest [ rdf:first :gammainfluenzavirus ;
                                            rdf:rest :nil ] ] ] ] ],
        :respiratory_system_disease,
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results in infection, located in respiratory tract, has_material_basis_in Influenzavirus A, has_material_basis_in Influenzavirus B, or has_material_basis_in Influenzavirus C, which are transmitted_by droplet spread of oronasal secretions during coughing, sneezing, or talking from an infected person. It is a highly contagious disease that affects birds and mammals and has_symptom chills, has_symptom fever, has_symptom sore throat, has_symptom runny nose, has_symptom muscle pains, has_symptom severe headache, has_symptom cough, and has_symptom weakness." ;
    :has_exact_synonym "Influenza with other manifestations"@en,
        "flu"@en,
        "influenza with non-respiratory manifestation"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:whipple_disease rdfs:subClassOf :intestinal_disease ;
    :has_exact_synonym "Whipple's disease"@en,
        "intestinal lipodystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:actinomycosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :granulomatous_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :actinomyces_naeslundii ;
                            rdf:rest [ rdf:first :actinomyces_viscosus ;
                                    rdf:rest [ rdf:first :actinomyces_israelii ;
                                            rdf:rest [ rdf:first :schaalia_odontolytica ;
                                                    rdf:rest [ rdf:first :arachnia_propionica ;
                                                            rdf:rest [ rdf:first :actinomyces_gerencseriae ;
                                                                    rdf:rest [ rdf:first :schaalia_meyeri ;
                                                                            rdf:rest :nil ] ] ] ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :respiratory_system ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :asthenia ],
        :commensal_bacterial_infectious_disease,
        :respiratory_system_disease ;
    :has_definition "A commensal bacterial infectious disease that results in infection, which is characterized by contiguous spread, suppurative and granulomatous inflammation, and formation of multiple abscesses and sinus tracts that may discharge sulfur granules, has_material_basis_in Actinomyces israelii, has_material_basis_in Actinomyces gerencseriae, has_material_basis_in Actinomyces naeslundii, has_material_basis_in Actinomyces odontolyticus, has_material_basis_in Actinomyces viscosus, has_material_basis_in Actinomyces meyeri, has_material_basis_in Propionibacterium propionicum, which require a break in the integrity of the mucous membranes and the presence of devitalized tissue to invade deeper body structures." ;
    :has_exact_match "MESH:D000196" ;
    :has_exact_synonym "Actinomycotic madura foot"@en,
        "Actinomycotic mycetema"@en,
        "Actinomycotic mycetoma of foot"@en,
        "Madura foot due to Actinomadura"@en,
        "actinomycotic infection"@en ;
    :has_related_synonym "actinomycetoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arthritis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_inflammation ],
        :bone_inflammation_disease ;
    :has_definition "A bone inflammation disease that involves a response to irritation or injury, characterized by joint pain, swelling, stiffness located_in joint." ;
    :has_exact_match "MESH:D001168" ;
    :has_exact_synonym "Inflammatory disorder of joint"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rheumatic_myocarditis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :streptococcus_pyogenes ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_symptom ;
                            owl:someValuesFrom :inflammation ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :myocardium ] ;
