        "Rheumatoid myocarditis"@en,
        "active rheumatic fever with myocarditis"@en,
        "acute rheumatic carditis"@en,
        "acute rheumatic myocarditis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transient_retinal_arterial_occlusion rdfs:subClassOf :retinal_artery_occlusion ;
    :has_exact_synonym "Retinal transient arterial occlusion"@en,
        "Transient arterial retinal occlusion"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_artery_occlusion rdfs:subClassOf :artery_disease,
        :retinal_vascular_occlusion ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :retinal_artery_occlusion ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :central_retinal_artery ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:maple_bark_strippers_lung rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        :lung_disease,
        :opportunistic_mycosis ;
    :has_definition "An opportunistic mycosis that is located_in lungs caused by inhalation of fungal spores while stripping the bark from maple logs, has_material_basis_in Cryptostroma corticale." ;
    :has_exact_synonym "Maple bark-strippers' lung"@en,
        "Maple-bark strippers' lung"@en,
        "alveolitis due to cryptostroma corticale"@en,
        "maple bark disease"@en,
        "maple bark stripper's disease"@en,
        "maple bark stripper's lung"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucormycosis rdfs:subClassOf :opportunistic_mycosis ;
    :has_definition "An opportunistic mycosis that results_in fungal infection located_in sinuses, located_in brain, or located_in lungs of immunocompromised people, has_material_basis_in Mucorales molds." ;
    :has_exact_synonym "disseminated mucormycosis"@en,
        "zygomycosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyhydramnios rdfs:subClassOf :placenta_disease ;
    :has_definition "A placenta disease that is characterized by an excess of amniotic fluid in the amniotic sac." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rheumatoid_arthritis_interstitial_lung_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease_of_musculoskeletal_system,
        :interstitial_lung_disease ;
    :has_definition "An interstitial lung disease that is characterized by the development of pleuroparenchymal disease secondary to rheumatoid arthritis, including pleural effusions, pleural fibrosis, pulmonary vascular disease, and airway complications." ;
    :has_exact_synonym "Rheumatoid lung"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_night_blindness rdfs:subClassOf :night_blindness ;
    :has_exact_synonym "Congenital night blindness"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:night_blindness rdfs:subClassOf :retinal_disease ;
    :has_definition "A retinal disease that is characterized by difficulty or the inability to see in relatively low light." ;
    :has_exact_synonym "nyctalopia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lung_disease rdfs:subClassOf :lower_respiratory_tract_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lung ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lower respiratory tract disease in which the function of the lungs is adversely affected by narrowing or blockage of the airways resulting in poor air flow, a loss of elasticity in the lungs that produces a decrease in the total volume of air that the lungs are able to hold, and clotting, scarring, or inflammation of the blood vessels that affect the ability of the lungs to take up oxygen and to release carbon dioxide." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fundus_dystrophy rdfs:subClassOf :eye_disease ;
    :has_exact_synonym "Retinal Dystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bullous_skin_disease rdfs:subClassOf :dermatitis ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :dermatitis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_symptom ;
                                    owl:someValuesFrom :blister ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A dermatitis that is characterized by blisters filled with a watery fluid, located_in skin. The disease is associated with the amount of gluten ingested." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:impetigo_herpetiformis rdfs:subClassOf :impetigo ;
    :has_definition "An impetigo that is characterized as a form of severe pustular psoriasis occurring in pregnancy." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:impetigo rdfs:subClassOf :pyoderma ;
    :has_definition "A pyoderma consisting of three forms of skin lesions having either a thick, adherent, recurrent, dirty yellow crust with an erythematous margin (common or superficial impetigo) or lessions which are superficial, thin-walled, and bullous as found in bullous impetigo. The lesions in bullous (staphylococcal) impetigo, which are always caused by S aureus, are superficial, thin-walled, and bullous." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dermatitis_herpetiformis rdfs:subClassOf :bullous_skin_disease ;
    :has_exact_synonym "Dermatosis herpetiformis"@en,
        "Duhring's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bullous_pemphigoid rdfs:subClassOf :pemphigoid ;
    :has_definition "A pemphigoid that is characterized by large blisters." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

