            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :young_adult_onset ],
        :dermatitis_herpetiformis .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:subcorneal_pustular_dermatosis rdfs:subClassOf :bullous_skin_disease ;
    :has_exact_synonym "Sneddon-Wilkinson disease or syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bartholin_s_duct_cyst rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :major_vestibular_gland ],
        :bartholin_s_gland_disease ;
    :has_definition "A female reproductive system disease that is characterized by a fluid-filled swelling in the Bartholin's glands." ;
    :has_exact_synonym "Bartholin duct cyst"@en,
        "Bartholin's Cyst"@en,
        "Cyst of Bartholin's gland"@en,
        "Cyst of Bartholin's gland duct"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cor_pulmonale rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :high_blood_pressure ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :heart_failure ],
        :congestive_heart_failure ;
    :has_definition "A congestive heart failure that involves a failure of the right side of the heart and is characterized by an enlargement of the right ventricle of the heart as a response to increased resistance or high blood pressure in the lungs." ;
    :has_exact_synonym "cardiopulmonary disease"@en,
        "pulmonary heart disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

