    :has_exact_synonym "Schilling's leukaemia"@en,
        "Schilling's leukemia"@en,
        "monocytic leukaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ulcer_of_lower_limbs rdfs:subClassOf :chronic_ulcer_of_skin ;
    :has_definition "A chronic ulcer of skin where the ulcer is not a decubitus ulcer." ;
    :has_exact_synonym "Ulcer of ankle"@en,
        "Ulcer of calf"@en,
        "Ulcer of heel and midfoot"@en,
        "Ulcer of thigh"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polymyalgia_rheumatica rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease_of_musculoskeletal_system,
        :collagen_disease ;
    :has_definition "A collagen disease that is characterized by pain, stiffness, and tenderness of the proximal muscle groups including the shoulder, pelvic girdle and the neck." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

