                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :hypopharynx ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A pharynx cancer that is located_in the hypopharynx." ;
    :has_exact_synonym "Hypopharyngeal cancer"@en,
        "malignant Hypopharyngeal tumor"@en,
        "malignant neoplasm of hypopharynx"@en,
        "malignant tumor of hypopharynx"@en,
        "malignant tumour of hypopharynx"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:herpes_zoster rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :paresthesia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :nervous_system ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :itching ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :human_alphaherpesvirus_3 ],
        :nervous_system_disease,
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection located_in nerve fiber, has_material_basis_in Human herpesvirus 3, which reactivates after appearing as chickenpox in childhood. The virus is transmitted_by direct contact with the rash, which can develop into chickenpox in newly-infected individuals. The infection has_symptom rash which is followed by blisters, has_symptom headache, has_symptom fever, has_symptom malaise, has_symptom itching, has_symptom burning pain, and has_symptom paresthesia." ;
    :has_exact_synonym "Shingles"@en,
        "herpes zona"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

