    :has_definition "A connective tissue disease that characterized by connective tissue disease that has_material_basis_in inheritable defects in collagen." ;
    :has_exact_synonym "collagen disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sezary_s_disease rdfs:subClassOf :primary_cutaneous_t_cell_non_hodgkin_lymphoma ;
    :has_exact_synonym "Sezary disease"@en,
        "Sezary syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

