        "Hodgkin's disease, lymphocyte predominance"@en,
        "Lymphocyte Rich Hodgkin's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_fatigue_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that involves prolonged and severe tiredness or weariness that is unrelated to exertion, is not relieved by rest and for a minimum of six months and is not directly caused by other conditions." ;
    :has_exact_synonym "CFS"@en,
        "Myalgic encephalitis"@en,
        "Myalgic encephalomyelitis"@en,
        "Postviral fatigue syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_hyperthermia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :muscle_tissue_disease ;
    :has_definition "A muscle tissue disease that is characterized by a drastic and uncontrolled increase in skeletal muscle oxidative metabolism, which overwhelms the body's capacity to supply oxygen, remove carbon dioxide, and regulate body temperature and that has_material_basis_in heterozygous mutation in the ryanodine receptor gene (RYR1) on chromosome 19q13. Manifestations of malignant hyperthermia (MH) are precipitated by certain volatile anesthetics (i.e., halothane, isoflurane, sevoflurane, desflurane, enflurane), either alone or in conjunction with a depolarizing muscle relaxant (specifically, succinylcholine)." ;
    :has_exact_synonym "anesthesia related hyperthermia"@en,
        "malignant hyperpyrexia due to anesthesia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_ulcer_of_skin rdfs:subClassOf :skin_disease ;
    :has_exact_synonym "Callous ulcer"@en,
        "Indolent ulcer"@en .

