    :has_exact_synonym "malignant tumor of vallecula"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oropharynx_cancer rdfs:subClassOf :pharynx_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :oropharynx ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A pharynx cancer that is located_in the oropharynx." ;
    :has_exact_synonym "Oropharyngeal carcinoma"@en,
        "malignant Oropharyngeal tumor"@en,
        "malignant tumor of oropharynx"@en,
        "malignant tumour of mesopharynx"@en,
        "oropharyngeal cancer"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biotinidase_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multiple_carboxylase_deficiency ;
    :has_definition "A multiple carboxylase deficiency that involves a deficiency in biotinidase as the body is not able to use biotin and results in biotin deficiency, and has_material_basis_in homozygous or compound heterozygous mutation in the BTD gene on chromosome 3p25." ;
    :has_exact_synonym "BTD deficiency"@en,
        "Juvenile-onset multiple carboxylase deficiency"@en,
        "Late-onset multiple carboxylase deficiency"@en,
        "deficiency of biotinidase"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:herpes_simplex rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :hand ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :human_alphaherpesvirus_1 ;
                            rdf:rest [ rdf:first :human_alphaherpesvirus_2 ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :mouth ;
                            rdf:rest [ rdf:first :face ;
                                    rdf:rest [ rdf:first :reproductive_structure ;
                                            rdf:rest :nil ] ] ] ] ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in_formation_of lesions, located_in mouth, located_in face, located_in genitalia, or located_in hands, has_material_basis_in Human herpesvirus 1 or has_material_basis_in Human herpesvirus 2, which are transmitted_by direct contact with an active lesion or body fluid of an infected person." ;
    :has_exact_synonym "Herpesvirus hominis disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

