    :has_exact_match "MESH:D006689",
        "NCI:C9357" ;
    :has_exact_synonym "HL"@en,
        "Hodgkin disease"@en,
        "Hodgkin lymphoma"@en,
        "Hodgkin's sarcoma"@en,
        "Hodgkins lymphoma"@en,
        "stage I Subdiaphragmatic Hodgkin Lymphoma"@en,
        "stage II Subdiaphragmatic Hodgkin Lymphoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infectious_mononucleosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :splenomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenopathy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :enlargement_of_lymph_nodes ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :human_gammaherpesvirus_4 ],
        :epstein_barr_virus_infectious_disease ;
    :has_definition "A viral infectious disease that results in inflammation, located in pharynx, has_material_basis_in Human herpesvirus 4 and has symptom fever, has symptom fatigue, has symptom lymphadenopathy, and has symptom splenomegaly." ;
    :has_exact_synonym "Filatov's disease"@en,
        "Gammaherpesviral mononucleosis"@en,
        "Monocytic angina"@en,
        "Pfeiffer's disease"@en,
        "glandular fever"@en,
        "mononucleosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_carboxylase_deficiency rdfs:subClassOf :amino_acid_metabolic_disorder,
        :carbohydrate_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves failures of carboxylation enzymes." ;
    :has_exact_match "MESH:D009100" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lichen_nitidus rdfs:subClassOf :lichen_disease ;
    :has_exact_synonym "Pinkus' disease"@en .

