            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease_of_gastrointestinal_tract,
        :colitis ;
    :has_definition "A colitis that is predominantly confined to the mucosa located_in colon and includes characteristic ulcers, or open sores." ;
    :has_exact_synonym "Left-sided ulcerative colitis"@en .
